import './App.css';
import Header from "./Pages/Header";
import Signup from './Pages/Signup';
import {BrowserRouter, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Switch>
          <Route path="/signup" component={Signup} /> {/* Add the route for Signup */}
          {/* Add other routes here */}
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
